import React from 'react';
import Card from './Card';
import MenuData from './MenuData';
const Services = () => {
  return (
    <div className='services'>
      <div className="sercive_card">
        {
          MenuData.map((val) => {
            <div className="heading">
              <h1>Our <span>Services</span></h1>
            </div>
            return (
              <Card
                img={val.img}
                title={val.title}
                price={val.price}
                btn={val.btn}
              />
            )
          })
        }
      </div>
    </div>
  )
}
export default Services;
